  false,\n\t\"url\": null,\n\t\"notes\": \"This booklet provides an overview of key
  findings and temporal trends from the Pacific Reef Assessment and Monitoring Program
  (Pacific RAMP) research surveys conducted in American Samoa in 2002, 2004, 2006,
  2008, and 2010 by the Coral Reef Ecosystem Division (CRED) of the NOAA Pacific Islands
  Fisheries Science Center (PIFSC) with financial support from NOAAu2019s Coral Reef
  Conservation Program. This summary report builds on the comprehensive analyses of
  research surveys from 2002 to 2006 published in the Coral Reef Ecosystem Monitoring
  Report for American Samoa 2002u20132006 (available at http://www.pifsc.noaa.gov/cred/hmapping/amsareport.php).
  All data sets used in this booklet will soon be available on the Web through the
  data dissemination tool on CREDu2019s website (http://www.pifsc.noaa.gov/cred).\",\n\t\"owner_org\":
